import Vue from 'vue';
import Router from 'vue-router';
import HomeVue from './views/HomeVue.vue'
import UsersVue from './views/UsersVue.vue'

Vue.use(Router)

export default new Router({
    routes: [{ path: "/", component: HomeVue }, {path: "/users", component: UsersVue}]
})
